def printarg( n, L ):
  print("Lampki    : ", n)
  print("Liczba op.: ", len(L))
  print("Operacje  : ",limit(L))

def printhint( hint ):
  print("Oczekiwany wynik:", hint )
  
def printsol( sol ):
  print("Uzyskany wynik  :", sol )

 
def check( n, L, hint, sol ):
  if sol == hint:
    print("Test zaliczony")
    return True
  else:
    print("NIEZALICZONY!")
    return False
    
    
def runtests( f ):
  internal_runtests( printarg, printhint, printsol, check, TESTS, f )

